import React, { useState } from 'react';
import { 
  Box, 
  Heading, 
  SimpleGrid, 
  Button, 
  Flex, 
  Input,
  InputGroup,
  InputLeftElement,
  Spinner,
  Text,
  Badge,
  useToast,
  Alert,
  AlertIcon
} from '@chakra-ui/react';
import { SearchIcon } from '@chakra-ui/icons';
import { useNavigate } from 'react-router-dom';
import { useExpeta } from '../context/ExpetaContext';

const GenerationsPage = () => {
  const { generations, loadGenerations, loading, error } = useExpeta();
  const [searchQuery, setSearchQuery] = useState('');
  const navigate = useNavigate();
  const toast = useToast();

  // Filter generations based on search query
  const filteredGenerations = generations?.filter(gen => 
    gen.expectation?.name?.toLowerCase().includes(searchQuery.toLowerCase()) || 
    gen.expectation?.description?.toLowerCase().includes(searchQuery.toLowerCase())
  ) || [];

  const handleRefresh = async () => {
    try {
      await loadGenerations();
      toast({
        title: 'Generations refreshed',
        status: 'success',
        duration: 2000,
        isClosable: true
      });
    } catch (err) {
      toast({
        title: 'Error refreshing generations',
        description: err.message,
        status: 'error',
        duration: 3000,
        isClosable: true
      });
    }
  };

  const handleViewGeneration = (id) => {
    navigate(`/generations/${id}`);
  };

  const formatDate = (dateString) => {
    if (!dateString) return 'Unknown date';

    const date = new Date(dateString);
    return date.toLocaleDateString() + ' ' + date.toLocaleTimeString();
  };

  return (
    <Box>
      <Flex justify="space-between" align="center" mb={6}>
        <Heading size="lg">Code Generations</Heading>
        <Button 
          colorScheme="blue" 
          variant="outline"
          onClick={handleRefresh}
        >
          Refresh
        </Button>
      </Flex>

      <Box mb={6}>
        <InputGroup>
          <InputLeftElement pointerEvents="none">
            <SearchIcon color="gray.300" />
          </InputLeftElement>
          <Input 
            placeholder="Search generations..." 
            value={searchQuery}
            onChange={(e) => setSearchQuery(e.target.value)}
          />
        </InputGroup>
      </Box>

      {loading.generations ? (
        <Flex justify="center" align="center" my={10}>
          <Spinner size="xl" />
          <Text ml={4}>Loading generations...</Text>
        </Flex>
      ) : error.generations ? (
        <Alert status="error" mb={6} borderRadius="md">
          <AlertIcon />
          {error.generations}
        </Alert>
      ) : filteredGenerations.length === 0 ? (
        <Box p={10} textAlign="center" bg="gray.50" borderRadius="md">
          <Text mb={4}>No code generations found</Text>
          <Button colorScheme="blue" onClick={handleRefresh}>
            Refresh
          </Button>
        </Box>
      ) : (
        <SimpleGrid columns={{ base: 1, md: 2 }} spacing={6}>
          {filteredGenerations.map((generation) => (
            <Box 
              key={generation.id}
              p={5}
              shadow="md"
              borderWidth="1px"
              borderRadius="md"
              bg="white"
              onClick={() => handleViewGeneration(generation.id)}
              cursor="pointer"
              _hover={{ shadow: "lg" }}
            >
              <Flex justify="space-between" mb={2}>
                <Heading fontSize="lg">{generation.expectation?.name || 'Unnamed Expectation'}</Heading>
                <Badge colorScheme={generation.success ? 'green' : 'red'}>
                  {generation.success ? 'Success' : 'Failed'}
                </Badge>
              </Flex>

              <Text fontSize="sm" color="gray.500" mb={3}>
                Generated: {formatDate(generation.created_at)}
              </Text>

              <Text noOfLines={2} mb={4}>
                {generation.expectation?.description || 'No description available'}
              </Text>

              <Flex justify="space-between">
                <Badge colorScheme="blue">
                  {generation.generated_code?.language || 'Unknown language'}
                </Badge>
                <Text fontSize="sm">
                  {generation.generated_code?.files?.length || 0} files
                </Text>
              </Flex>
            </Box>
          ))}
        </SimpleGrid>
      )}
    </Box>
  );
};

export default GenerationsPage;
